import React, { Component } from 'react';
import Video from '../assets/Data/videos.json';

export class Videos extends Component {


    render() {
        const video1 = Video;
        console.log(Video.title);
        return (
            <div className='video'>
                <div className='video__player'>{video1.title}</div>
            </div>
        )
    }
}

export default Videos;
